import React from 'react';
import './App.css';

function App() {
  return <div>
  	<h2>Course Goals</h2>
  	<ul className="goal-list">
  		<li>Finish the course</li>
  		<li>Learn a lot</li>
  		<li>Eearn money :v</li>
  	</ul>
  </div>;
}

export default App;
